class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        m=len(board)
        n=len(board[0])
        board2=[[[board[i][j],j] for j in range(n)] for i in range(m)]
        for i in range(m):
            board2[i].sort()
        #print(board2)
        nb3=[[board2[i][-1],board2[i][-2],board2[i][-3]] for i in range(m)]

        ans=-int(1e10)
        for i in range(m):
            for j in range(i+1,m):
                for k in range(j+1,m):
                    for a1 in range(3):
                        for a2 in range(3):
                            for a3 in range(3):
                                if nb3[i][a1][1]!=nb3[j][a2][1] and nb3[i][a1][1]!=nb3[k][a3][1] and nb3[j][a2][1]!=nb3[k][a3][1]:
                                    ans=max(ans,nb3[i][a1][0]+nb3[j][a2][0]+nb3[k][a3][0])
        return ans
